import React, { Component } from 'react'
import './Social.css'

export default class Social extends Component {
  render() {
    return (
      <div className='Social' >
        <h2>Читайте самые актуальные новости из мира каршеринга в наших социальных сетях:</h2>
        <p>телегам вк инст</p>
        <img src='./deli.jpg' ></img>
        <Image source={require("./deli.jpg")} style={{width: 100, height: 100}}/>
      </div>
    )
  }
}
